import React from 'react';

class Sports extends React.Component{
    constructor(name,number,points){
        super();
        this.name = name;
        this.number = number;
        this.points = points;
        this.test = "mytest";
    }

    print(){
        alert(this.name, this.points);
    }


}

export default Sports;
